import React from 'react';
import { useEffect,useState } from "react";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from './Card.js'
import { trackPromise } from 'react-promise-tracker';
import Button from 'react-bootstrap/Button';

const Card_info = ()=> {
	const [robots233 , setrobots233] = useState([]) 

	useEffect(() =>{    
		trackPromise(
			fetch('https://api.pokemontcg.io/v2/cards?page=1&pageSize=100s').then(response => response.json()).then(users =>{
				setrobots233(users.data)
			}))

	})

    return(
            <div className=''>
            <article class="vh-100 dt w-100 bg-dark-pink">
            <div class="dtc v-mid tc white ph3 ph4-l">
            <article className="mw6 center bg-white br3 pa2 pa4-ns mv3 ba b--black-10 shadow-3">
            <Row>
            <Col className='col-md-6'>
            <img src='https://assets.pokemon.com/assets/cms2/img/cards/web/SWSH12TG/SWSH12TG_EN_TG17.png'/>
            <Button className='btn_2 mt-4 '>Explore More Cards</Button>
            </Col>
            <Col className='col-md-6'>
            <h3 className='b text-black'>{robots233.name}</h3>
            <Row>
            <Col className='col-md-6'> 
            <p className='b text-black' >{robots233.supertype}</p>
            </Col>
            <Col className='col-md-6'>

            <p className='b text-black' >Pokemon</p>
            </Col>
            </Row>
            </Col>
            </Row>
            </article>
                    </div>
                    </article>
            </div>
    )
}
export default Card_info
